.','Unique identifier for the product.'=>'Muista poikkeava tunniste tuotteelle.','Supported features for this payment gateway.'=>'Tämän maksukäytävän tuetut ominaisuudet.','Avatar URLs for the object reviewer.'=>'Kohteen arvioijalle avatar-kuvan verkko-osoitteet.','If true, this note will be attributed to the current user. If false, the note will be attributed to the system.'=>'Kun tosi, tämä kommentti liitetään nykyiseen käyttäjään. Kun epätosi, kommentti liitetään järjestelmään.','Order note author.'=>'Tilauskommentin kirjoittaja.','View affected templates'=>'Näytä sivupohjat joihin vaikuttaa','The object has already been trashed.'=>'Kohde on jo siirretty roskakoriin.','Update your theme to the latest version. If no update is available contact your theme author asking about compatibility with the current WooCommerce version.'=>'Päivitä teema uusimpaan versioon. Jos päivitystä ei ole saatavilla, ota yhteyttä teeman tekijään ja kysy yhteensopivuutta nykyisen WooCommerce version kanssa.','Your {site_title} order has been received!'=>'Tilauksesi verkkokaupasta {site_title} on vastaanotettu!','Thanks for shopping with us'=>'Kiitos kun asioit kaupassamme','Limit response to resources created after a given ISO8601 compliant date.'=>'Rajoita vastaus resursseihin, jotka julkaistiin annetun ISO8601-yhteensopivan päiväyksen jälkeen.','Ensure result set excludes reviews assigned to specific user IDs.'=>'Varmista että tulosjoukosta rajattu pois arvioinnit tietyn käyttäjätunnuksen/ID mukaan.','Details for order #{order_number} on {site_title}'=>'Tiedot tilaukselle #{order_number} verkkokaupassa {site_title}','When handling an %s, should personal data within orders be retained or removed?'=>'Kun käsitellään %s, pitäisikö tilauksissa olevat henkilökohtaiset tiedot säilyttää vai poistaa?','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'Kun käsitellään %s, pitäisikö pääsy ladattaviin tiedostoihin kumota ja latauslokit tyhjentää? ','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>Käyttämäsi teema (%s) sisältää vanhentuneita kopioita joistakin WooCommerce malline tiedostoista.</strong> Nämä tiedostot voi joutua päivittämään jotta ne ovat yhteensopivia nykyisen WooCommerce version kanssa.  Suositukset asian korjaamiseksi:','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Olemme luoneet kaksi toimitusvyöhykettä - %s alueelle ja muulle maailmalle. Alla voit asettaa kiinteähintaiset hinnat näille vyöhykkeille tai tarjota maksuttoman toimituksen.','Placeholder image'=>'Kuvan paikanvaraaja','Enter attachment ID or URL to an image'=>'Kirjoita liitteen tunnus/ID tai kuvan verkko-osoite','Export all categories'=>'Vie kaikki osastot','WooCommerce Services icon'=>'WooCommerce Services -kuvake','Which product category should be exported?'=>'Mikä tuoteosasto viedään?','WooCommerce PayPal Checkout Gateway'=>'WooCommerce PayPal Checkout -maksukäytävä','Low stock amount'=>'Varasto vähissä määrä','Set up PayPal for me using this email:'=>'Valmistele minulle PayPal käyttäen tätä sähköpostiosoitetta:','ShipStation'=>'ShipStation','ShipStation icon'=>'ShipStation kuvake','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Käytämme %1$s tuotteen painolle ja %2$s tuotteen mitoille.','Set up Stripe for me using this email:'=>'Valmistele minulle Stripe käyttäen tätä sähköpostiosoitetta:','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Kun haluat tarjota <span class="help_tip" data-tip="%1$s">tosiaikaiset hinnat</span> tietyltä kuljetusliikkeeltä (esim. UPS) WooCommerceen on saatavilla useita laajennuksia <a href="%2$s" target="_blank">täältä</a>.','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Tosiaikainen hinta on tarkka tilauksen toimitushinta, jonka kuljetusyritys tarjoaa suoraan.','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'Kirjoita luku jolla asetetaan varaston määrä muunnelman tasolla. Käytä muunnelman \'Aseta määrä varastossa?\' -valintaruutua jolla otat käyttöön/ poistat käytöstä varaston hallinnoinnin muunnelmien tasolla.','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Tämä on liitteen tunnus/ID tai sen kuvan verkko-osoite jota käytetään kuvan paikanvaraajana tuoteluettelossa. Tätä käyttävät ne tuotteet joille ei ole kuvaa.','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Suosittelemme, että käytät ShipStationia. Säästääksesi aikaa postissa voit tulostaa osoitelaput kotona. Kokeile ShipStationia maksutta 30 päivän ajan.','Are you sure you want to remove the selected items?'=>'Haluatko varmasti poistaa valitut kohteet?','Item moved up'=>'Kohde siirretty ylös','Item moved down'=>'Kohde siirretty alas','Millimeters'=>'Millimetrejä','Centimeters'=>'Senttimetrejä','Meters'=>'Metrejä','Ounces'=>'Unsseja','Grams'=>'Grammoja','Kilograms'=>'Kilogrammoja','Yards'=>'Jaardia','Inches'=>'Tuumaa','Pounds'=>'Paunaa','Alto Paraguay'=>'Alto Paraguay','Presidente Hayes'=>'Presidente Hayes','Amambay'=>'Amambay','Cordillera'=>'Cordillera','San Pedro'=>'San Pedro','Sud Sardegna'=>'Sud Sardegna','Central'=>'Central','You may need to manually restore the item\'s stock.'=>'Voit joutua manuaalisesti kasvattamaan tuotteen määrän varastossa.','%d API key permanently revoked.'=>'%d API-avain poistettu pysyvästi.' . "\0" . '%d API-avainta poistettu pysyvästi.','Apartment, suite, unit, etc.'=>'Huoneisto, yksikkö, jne.','Cannot set attributes due to invalid parent product.'=>'Ominaisuuksia ei voi asettaa koska ylemmän tason tuote ei kelpaa.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Tätä toimintoa ei voi perua. Haluatko varmasti poistaa henkilökohtaiset tiedot valituista tilauksista?','Payer last name'=>'Maksajan sukunimi','Payer first name'=>'Maksajan etunimi','Billing Address'=>'Laskutusosoite','Shipping Address'=>'Toimitusosoite','Shipping Address 1'=>'Toimitusosoite 1','Billing Address 1'=>'Laskutusosoite 1','Payer PayPal address'=>'Maksajan PayPal-osoite','shipping packagesShipping %d'=>'Toimitus %d','MySQL version string.'=>'MySQL version merkkijono.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'CSV tiedostossa tulee olla sarakkeet tietyssä järjestyksessä. %1$sLataa tästä esimerkki%2$s.','This will be how your name will be displayed in the account section and in reviews'=>'Nimesi näytetään tällä tavalla tilinäytöllä ja arvioissa','United States (US) dollar'=>'USA:n dollari USD','terms and conditions'=>'tilaus- ja sopimusehdot','privacy policy'=>'Yksityisyyden suoja','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal:ille voi lähettää yhden osoitteen. Jos käytät PayPal-palvelua osoitelappujen tekemiseen, on ehkä parempi lähettää toimitusosoite eikä laskutusosoitetta. Kun tämä otetaan pois käytöstä, se voi estää PayPal:in myyjänsuojelu ominaisuuden toiminnan.','eCheck ending in %1$s'=>'eCheck joka päättyy %1$s','Other locations'=>'Muut sijainnit','Account details:'=>'Tilin tiedot:','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Mikä tahansa &quot;%1$s&quot; menetelmä','%s page'=>'%s sivu','No page set'=>'Sivua ei ole asetettu','Required'=>'Vaaditaan','%s field'=>'%s kenttä','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard ohjaa asiakkaat PayPal-palveluun jossa he voivat kirjoittaa maksamisen tiedot.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'että, jotta, koska, kun, jos, vaikka, kuin, kunnes, ellei, jollei, www, com, on, tämä, tuo, se, nämä, nuo, ne, kuka, mitä, missä, milloin,','Optionally add some text for the terms checkbox that customers must accept.'=>'Valinnaisesti kirjoita joku teksti Toimitus- ja sopimusehtojen valintaruutuun joka asiakkaiden on hyväksyttävä.','Highlight required fields with an asterisk'=>'Korosta vaaditut kentät tähtimerkillä','These options let you change the appearance of the WooCommerce checkout.'=>'Näillä valinnoilla voit muuttaa WooCommerce kassan ilmettä.','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Vastaanota sekkimaksuja henkilökohtaisesti. Tämä maksutapa ei käytä nettiä ja se on myös hyödyllinen maksamisen testaamisessa.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Vastaanota maksuja henkilökohtaisesti pankkisiirrolla (esim. SEPA-maksu). Tunnetaan myös nimillä direct bank - tai wire transfer.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Katso <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">täältä lisää PayPal yksityisyydensuojasta</a>.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Hyväksymme PayPal-maksuja. Kun maksuja käsitellään, joitakin tietojasi siirretään PayPal-maksupalveluun. Näitä tietoja ovat mm. tiedot joita tarvitaan maksun toteuttamisessa tai -tukemisessa, esimerkiksi ostosten kokonaissumma ja laskutus tiedot.','I have read and agree to the website %s'=>'Olen lukenut ja hyväksyn sivuston %s','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Tässä osassa sinun tulisi listata ne kolmannen osapuolen maksukäytävät joita käytät sivustolla maksujen vastaanottamisessa koska ne voivat käsitellä asiakkaan tietoja. Olemme sisällyttäneet PayPal:in esimerkkinä, mutta poista se jos et käytä PayPal-maksupalvelua.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Jaamme tietoja niiden kolmansien osapuolten kanssa jotka auttavat meitä käsittelemään tilauksia ja tuottamaan sivuston palveluita; esimerkiksi --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Tässä osassa sinun tulisi listata kenen kanssa jaat tietoja ja mitä tarkoitusta varten. Tämä voi sisältää, mutta ei rajoitu, sivuston analytiikkaan, markkinointiin, maksukäytäviin, toimittajiin ja kolmannen osapuolen upotuksiin sivustolla.','What we share with others'=>'Mitä jaamme muiden kanssa','Who on our team has access'=>'Ketkä tiimistämme pääsevät käsiksi','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Tilaustiedot kuten mitä ja milloin ostettiin ja minne tilaus lähetettiin sekä','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Tiimimme jäsenet pääsevät näihin tietoihin jotta voivat täyttää tilaukset, käsitellä hyvitykset ja voivat tarjota tukea.','Customer information like your name, email address, and billing and shipping information.'=>'Asiakkaan tiedot kuten nimi, sähköpostiosoite ja laskutus- ja toimitus tiedot.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Tiimimme jäsenet pääsevät tietoihin joita annat meille. Esimerksi, sekä Ylläpitäjät että Kauppiaat pääsevät näihin:','We will also store comments or reviews, if you choose to leave them.'=>'Tallennamme myös kaupan kommentit ja tuotearvioinnit jos kirjoitat sellaisia.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Yleensä säilytämme tietojasi niin kauan kuin tarvitsemme niitä niihin tarkoituksiin joita varten keräämme tiedot ja käytämme tietoja ja niin kauan kuin meidän on ne lain mukaan säilytettävä. Esimerkiksi, säilytämme kaupan tiedot (?) vuodeksi verotusta ja kirjanpitoa varten.Tämä sisältää nimen, sähköpostiosoitteen ja laskutus- ja toimitusosoitteet.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Jos luot tilin, tallennamme nimen, osoitteen, sähköpostiosoitteen ja puhelinnumeron joita käytetään kassalla täyttämään kenttiä tulevissa tilauksissa.','Send you marketing messages, if you choose to receive them'=>'Lähettää markkinointiviestejä, jos valitset että haluat vastaanottaa niitä.','Improve our store offerings'=>'Parantaa kaupan tarjontaa','Comply with any legal obligations we have, such as calculating taxes'=>'Noudattaa kaikkia lain velvotteita, kuten verojen maksaminen','Set up your account for our store'=>'Luoda käyttäjätilisi kauppaamme','Process payments and prevent fraud'=>'Käsitellä maksuja ja estää petollista toimintaa','Respond to your requests, including refunds and complaints'=>'Vastata pyyntöihisi, mukaan lukien hyvitykset ja valitukset','Send you information about your account and order'=>'Lähettää tietoja tilistäsi ja tilauksesta','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kun ostat meiltä, pyydämme tietoja kuten nimi, laskutusosoite, toimitusosoite, sähköpostiosoite, puhelinnumero, luottokortin tai maksamisen tiedot ja valinnaiset käyttäjätilin tiedot kuten käyttäjätunnus ja salasana. Käytämme näitä tietoja tarkoituksiin kuten :','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Käytämme evästeitä myös jotta säilytät ostoskorin sisällön kun selaat sivustoa.','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Huom.: Voit halutessasi kuvailla tarkemmin evästeiden käytön ja linkittää täältä evästeiden selostukseen.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Toimitusosoite: Kysymme tätä, jotta voimme -esimerkiksi-  arvioida toimituskulut ennen kuin teet tilauksen ja lopuksi lähettää tilauksen.','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Sijainti, IP-osoite ja selaimen tyyppi: Näiden avulla arvioimme verojen ja toimituskulujen määrän','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Tuotteet joita olet katsonut: Käytämme tätä, esimerkiksi, kun näytämme tuotteita joita olet äskettäin katsonut.','What we collect and store'=>'Mitä keräämme ja säilytämme','While you visit our site, we’ll track:'=>'Kun vierailet tällä sivustolla, seuraamme:','We collect information about you during the checkout process on our store.'=>'Keräämme tietoja sinusta kaupan kassalla.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Tämä esimerkkiteksti sisältää perusasiat tiedoista joita kauppasi voi mahdollisesti kerätä, tallentaa ja jakaa ja lisäksi kenellä on pääsy tietoihin. Riippuen asetuksista ja käytössä olevista lisäosista, eri kauppojen jakamat tiedot voivat vaihdella. Suosittelemme kysymään lakihenkilöltä mitä tietoja voit paljastaa yksityisyydensuojassa.','Browser User Agent'=>'Selain','Items Purchased'=>'Ostetut tuotteet','Order Number'=>'Tilauksen numero','Access granted'=>'Pääsy sallittu','Download count'=>'Latausten lukumäärä','User email'=>'Käyttäjän sähköpostiosoite','Token'=>'Poletti','Payment Tokens'=>'Maksutietojen poletit','Personal data removed.'=>'Henkilökohtaiset tiedot poistettu.','Shipping State'=>'Toimitusalue','Shipping Postal/Zip Code'=>'Postinumero/-koodi','Shipping City'=>'Toimituskaupunki','Shipping Company'=>'Toimittava yritys','Shipping Last Name'=>'Toimitus, sukunimi','Shipping First Name'=>'Toimitus, etunimi','Phone Number'=>'Puhelinnumero','Billing State'=>'Laskutusalue','Billing Postal/Zip Code'=>'Laskutus postinumero/-koodi','Billing City'=>'Laskutuskaupunki','Billing Company'=>'Laskutettava yritys','Billing Last Name'=>'Laskutus, sukunimi','optional'=>'valinnainen','Display name'=>'Näyttönimi','Display name cannot be changed to email address due to privacy concern.'=>'Näyttönimeä ei voi vaihtaa sähköpostiosoitteeksi koska yksityisyyden suoja vaarantuisi.','display name%1$s %2$s'=>'%1$s %2$s','Download ID'=>'Latauksen tunnus/ID','Customer Data'=>'Asiakkaan tiedot','Error during status transition.'=>'Tilan vaihtamisessa tapahtui virhe.','Update status event failed.'=>'Tilan päivitystapahtuma ei onnistunut.','Payment complete event failed.'=>'Maksun loppuunsaattaminen ei onnistunut.','Cloning is forbidden.'=>'Monistus on kielletty.','Unserializing instances of this class is forbidden.'=>'Tämän luokan kohteista ei saa poistaa sarjanumerointia.','Deleted all active sessions, and %d saved carts.'=>'Poisti kaikki käytössä olleet istunnot ja %d tallennettua ostoskoria.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Tämä työkalu poistaa tietokannasta kaikki asiakkaiden istunnot, mukaan lukien käytössä olevat ostoskorit ja tallennetut ostoskorit.','If the payment was refunded via the API.'=>'Jos maksu oli hyvitetty rajapinnan kautta.','Order total formatted for locale'=>'Tilauksen summa muotoiltu paikalliseksi','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s on poistettu ostoskorista koska sitä on muutettu lisäämisen jälkeen. Voit lisätä tuotteen takaisin ostoskoriin <a href="%2$s">täällä</a>.','Billing First Name'=>'Laskutus, etunimi','Name of the customer for the order'=>'Tilauksen asiakkaan nimi','URL to edit the order'=>'Verkko-osoite tilauksen muokkaamiseksi','Blog id of the record on the multisite.'=>'Monisivustolla olevan tiedon blogitunnus/ID ','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Kauppa ei näyttäisi käyttävän suojattua yhteyttä. Suosittelemme että koko sivusto toimii suojatun HTTPS-yhteyden kautta jotta asiakkaiden tiedot ovat turvassa. <a href="%s">Lisätietoja täällä.</a>','Access to Purchased Downloads'=>'Pääsy ostettuihin digitaalisiin latauksiin','User roleCustomer'=>'Asiakas','Clean up download permissions'=>'Tyhjennä latausten oikeudet','Removed customer "%s"'=>'Käyttäjä "%s" poistettu','Purchased Downloads'=>'Ostetut lataukset','Unable to create order.'=>'Tilausta ei voitu luoda.','Removed payment token "%d"'=>'Maksutietojen poletti "%d" poistettiin','Customer download permissions have been retained.'=>'Asiakkaan latausoikeudet säilytettiin.','Removed access to downloadable files.'=>'Poistettiin pääsy ladattaviin tiedostoihin.','Personal data within order %s has been retained.'=>'Tilauksen %s sisältämät henkilökohtaiset tiedot säilytettiin.','Removed personal data from order %s.'=>'Tilauksesta %s poistettiin henkilökohtaiset tiedot.','User roleShop manager'=>'Kauppias','%d permissions deleted'=>'%d oikeudet poistettiin','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Tämä työkalu poistaa umpeutuneet latausoikeudet ja oikeudet joissa on jäljellä 0 latauskertaa.','Used-up download permissions'=>'"Kaikki käytetty" -latausoikeudet','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Rajoita tulokset tuotteisiin joilla tietty ominaisuus. Käytä luokittelunimeä tai ominaisuuden polkutunnusta.','Please read and accept the terms and conditions to proceed with your order.'=>'Ole hyvä, lue ja hyväksy tilaus- ja toimitusehdot jotta voit edetä tilauksen tekemisessä.','WooCommerce pages'=>'WooCommerce sivut','WooCommerce database version'=>'WooCommerce tietokannan versio','External object cache'=>'Ulkopuolinen kohteiden välimuisti','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress testaustila','WordPress memory limit'=>'WordPress muistirajoitus','WordPress multisite'=>'WordPress monisivusto (multisite)','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Uudempi WordPress on saatavilla (%2$s)','WordPress version'=>'WordPress versio','WooCommerce version'=>'WooCommerce versio','Settings tab labelPayments'=>'Maksut','Enable coupons'=>'Ota käyttöön kupongit','Enable tax rates and calculations'=>'Ota käyttöön veroprosentit ja laskeminen','Manage'=>'Hallinnoi','Account endpoints'=>'Tilin verkko-osoitteen loppuliitteet','Secure checkout'=>'Turvallinen kassasivu','Legacy API'=>'Vanha API-rajapinta','Displays whether or not WordPress is using an external object cache.'=>'Näyttää käyttääkö WordPress ulkopuolista välimuistia.','Rates will be configurable and taxes will be calculated during checkout.'=>'Veroprosentteja voi muuttaa ja verot lasketaan kassalla.','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Säilytä valmiit tilaukset tietty aika jonka jälkeen henkilökohtaiset tiedot muutetaan tunnistamattomaan muotoon.','Retain completed orders'=>'Säilytä valmiit tilaukset','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Peruttuja tilauksia ei ole maksettu ja joko kauppias tai asiakas on voinut tehdä peruutuksen. Ne siirretään roskakoriin tietyn ajan kuluttua. ','Retain cancelled orders'=>'Säilytä perutut tilaukset','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Epäonnistuneita tilauksia ei ole maksettu ja joko kauppias tai asiakas on voinut tehdä peruutuksen. Ne siirretään roskakoriin tietyn ajan kuluttua.','Retain failed orders'=>'Säilytä epäonnistuneet tilaukset','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Odottavia tilauksia ei ole maksettu ja joko kauppias tai asiakas on voinut tehdä peruutuksen. Ne siirretään roskakoriin tietyn ajan kuluttua.','Accounts &amp; Privacy'=>'Tilit &amp; Yksityisyys','Optionally add some text about your store privacy policy to show during checkout.'=>'Vaihtoehtona kirjoita teksti jota käytetään kassalla yksityisyyden suoja -kohdassa.','Checkout privacy policy'=>'Kassan yksityisyyden suoja','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Vaihtoehtona kirjoita teksti jota käytetään tilin rekisteröinti sivulla, yksityisyyden suoja -kohdassa.','Registration privacy policy'=>'Rekisteröitymisen yksityisyyden suoja','Privacy policy'=>'Yksityisyyden suoja','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Täällä asetetaan kuinka sivuston yksityisyyden suoja näytetään. Alla olevia yksityisyyden suoja ilmoituksia ei näytetä ellei yksityisyyden suoja sivua ole ensin asetettu.','Remove personal data'=>'Poista henkilökohtaiset tiedot','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Henkilökohtaisia tietoja käytetään tilausten käsittelyssä, sivuston käyttökokemuksen tukemisessa ja muissa tarkoituksissa kuten on esitetty %s.','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Henkilökohtaisia tietoja käytetään sivuston käyttökokemuksen tukemisessa tällä sivustolla, pääsyssä tiliisi ja muissa tarkoituksissa kuten on esitetty %s.','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Luettelo sallitusta sähköpostiosoitteista johon verrataan asiakkaan laskutus sähköpostiosoitetta kun tilaus tehdään. Erota sähköpostiosoitteet pilkulla. Voit myös käyttää tähtimerkkiä (*) joka kattaa osan sähköpostiosoitetta. Esimerkiksi "*@gmail.com" sallii kaikki Gmail sähköpostiosoitteet.','Retain inactive accounts '=>'Säilytä ei-käytetyt käyttäjätilit','Retain pending orders '=>'Säilytä odottavat tilaukset','Allowed emails'=>'Sallitut sähköpostit','Account erasure requests'=>'Tilinpoistopyynnöt','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Ei-käytetyt tilit ovat tilejä joihin ei ole kirjauduttu, tai ei ole tehty tilausta tietyn ajan kuluessa. Ne poistetaan. Tehdyt tilalukset muutetaan vierailijoiden tilauksiksi.','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Valitse kuinka kauan henkilökohtaisia tietoja säilytetään kun niitä ei enää tarvita käsittelyssä. Kun tyhjä, tiedot säilytetään ilman aikarajoitusta.','Personal data retention'=>'Henkilökohtaisten tietojen säilyttäminen','Use previous column mapping preferences?'=>'Käytä edellisen tuonnin kohdistusvalintoja sarakkeissa?','Removed personal data from %s order.'=>'Henkilötiedot poistettu %s tilauksesta.' . "\0" . 'Henkilötiedot poistettu %s tilauksista.','privacy page'=>'Yksityisyys sivu','Filter by registered customer'=>'Suodata asiakkaiden mukaan','Review Settings'=>'Tarkasta asetukset','Visit Dashboard'=>'Siirry hallintapaneeliin','You can also:'=>'Voit myös:','You\'re ready to add products to your store.'=>'Voit aloittaa tuotteiden lisäämisen kauppaan.','Create some products'=>'Luo joitakin tuotteita','View &amp; Customize'=>'Näytä &amp; Mukauta','Continue with WooCommerce Services'=>'Jatka WooCommerce Services (-palveluilla)','Connect your store to activate WooCommerce Services'=>'Ota käyttöön WooCommerce Services (-palvelut) yhdistämällä kauppa ','Thanks for using Jetpack! Your store is almost ready: to activate services like %s